import {React, useState} from 'react'

export default function Home() {
    const [planet, setPlanet] = useState("")
    const [weight, setWeight] = useState(0.0)
    const [calculatedWeight, setCalculatedWeight] = useState(0.0)
    let counter = 0;
    function slideshow() {
        let astro = document.getElementById("astronaut-pic");
        let mars = document.getElementById("mars-pic");
        let rocket = document.getElementById("rocket-pic");
        astro.style.display = "none"
        mars.style.display = "none"
        rocket.style.display = "none"
        counter++
        console.log(counter)
        if (counter > 3) {
            counter = 1
            astro.style.display = "block";
        } else if (counter === 1) {
            astro.style.display = "block";
        } else if (counter === 2) {
            mars.style.display = "block";
        } else if (counter === 3) {
            rocket.style.display = "block";
        } 
        setTimeout(slideshow, 6000);
    }

    function calculateWeight(dplanet) {
        console.log("calculating weight")
        let picz = document.getElementsByClassName("planet-pic");
        for (let i=0;i<picz.length;i++) {
            picz[i].style.display = "none";
        }
        let appear = document.getElementById("weight-results")
        appear.style.display = "block"
        switch(dplanet) {
            case "venus" :
                setCalculatedWeight(weight*.9);
                let minivenus = document.getElementById("mini-venus");
                minivenus.style.display = "block";
                break;
            case "mars" :
                setCalculatedWeight(weight*.38);
                let minimars = document.getElementById("mini-mars");
                minimars.style.display = "block";
                break;
            case "jupiter" :
                setCalculatedWeight(weight*2.4);
                let minijupiter = document.getElementById("mini-jupiter");
                minijupiter.style.display = "block";
                break;
            case "saturn" :
                setCalculatedWeight(weight*1.07);
                let minisaturn = document.getElementById("mini-saturn");
                minisaturn.style.display = "block";
                break;
            case "uranus" :
                setCalculatedWeight(weight*.87);
                let miniuranus = document.getElementById("mini-uranus");
                miniuranus.style.display = "block";
                break;
            case "neptune" :
                setCalculatedWeight(weight*1.1);
                let minineptune = document.getElementById("mini-neptune");
                minineptune.style.display = "block";
                break;
            case "black hole" :
                setCalculatedWeight(weight*14000000);
                break;
            default:
                setCalculatedWeight(weight);
        }
    }

    return (
        <div className="main" id="main">
            <div className="carousel-container">        
                <div className="pics-container">
                    <img className="home-pic" id="astronaut-pic" src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/62/AS15-88-11866_-_Apollo_15_flag%2C_rover%2C_LM%2C_Irwin_-_restoration1.jpg/1200px-AS15-88-11866_-_Apollo_15_flag%2C_rover%2C_LM%2C_Irwin_-_restoration1.jpg"/>
                </div>
                <div className="pics-container">
                    <img className="home-pic" id="mars-pic" src="data:image/jpeg;base64,"/>
                </div>
                <div className="pics-container">
                    <img className="home-pic" id="rocket-pic" src="data:image/jpeg;base64,"/>
                </div>
            </div>
            <div className="intro-container">
                <div className="intro-content">
                    <div className="main-title">
                        <h1>EXPLORE</h1>
                    </div>
                    <p>The universe is waiting for you... </p>
                </div>
                <div className="intro-content">
                    <div className="main-title">
                        <h1>IMAGINE</h1>
                    </div>
                    <p>Anything is possible... </p>
                </div>
                <div className="intro-content">
                    <div className="main-title">
                        <h1>WONDER</h1>
                    </div>
                    <p>So many unanswered questions... </p>
                </div>
                <div className="secondary-intro-content">
                    <table>
                        <tbody>
                            <tr>
                                <th>Planet Name</th>
                                <th>Diameter Size</th> 
                                <th>Distance from Earth</th>
                            </tr>
                            <tr>
                                <td>Mercury</td>
                                <td>4,800 km</td>
                                <td>57,000,000 km</td>
                            </tr>
                            <tr>
                                <td>Venus</td>
                                <td>12,100 km</td>
                                <td>108,000,000 km</td>
                            </tr>
                            <tr>
                                <td>Earth</td>
                                <td>12,700 km</td>
                                <td>149,000,000 km</td>
                            </tr>
                            <tr>
                                <td>Mars</td>
                                <td>6,700 km</td>
                                <td>227,000,000 km</td>
                            </tr>
                            <tr>
                                <td>Jupiter</td>
                                <td>142,900 km</td>
                                <td>778,000,000 km</td>
                            </tr>
                            <tr>
                                <td>Saturn</td>
                                <td>120,500 km</td>
                                <td>1,438,000,000 km</td>
                            </tr>
                            <tr>
                                <td>Uranus</td>
                                <td>51,100 km</td>
                                <td>2,871,000,000 km</td>
                            </tr>
                            <tr>
                                <td>Neptune</td>
                                <td>49,500 km</td>
                                <td>4,495,000,000 km</td>
                            </tr>
                        </tbody>
                    </table>
                    <div className="weight-section">
                        <div className="weight-input">
                            <label htmlFor="weight-input">Weight in kg: </label>
                            <input type="text" id="weight-input" name="weight-input" placeholder="eg. 73.5" onChange={(e)=>setWeight(e.target.value)}/>
                                <select onChange={(e)=> {
                                    const selectedPlanet = e.target.value;
                                    setPlanet(e.target.value);
                                    if (weight) {
                                        calculateWeight(e.target.value)
                                        console.log(e.target.value, weight)
                                    }
                                    }}>
                                    <option value="venus" >Venus</option>
                                    <option value="mars" >Mars</option>
                                    <option value="jupiter" >Jupiter</option>
                                    <option value="saturn" >Saturn</option>
                                    <option value="uranus" >Uranus</option>
                                    <option value="neptune" >Neptune</option>
                                    <option value="black hole" >Black Hole</option>
                                </select>
                        </div>
                            
                        <div className="weight-results" id="weight-results">
                            <p>You would weigh {calculatedWeight}kgs on {planet}</p>
                            <div className="planetpic-container">
                                <img id="mini-mercury" src="data:image/jpeg;base64," className="planet-pic"/>
                                <img id="mini-venus" src="data:image/jpeg;base64," className="planet-pic"/>
                                <img id="mini-earth" src="data:image/jpeg;base64," className="planet-pic"/>
                                <img id="mini-mars" src="data:image/jpeg;base64," className="planet-pic"/>
                                <img id="mini-jupiter" src="data:image/jpeg;base64," className="planet-pic"/>
                                <img id="mini-saturn" src="data:image/jpeg;base64," className="planet-pic"/>
                                <img id="mini-uranus" src="data:image/jpeg;base64," className="planet-pic"/>
                                <img id="data:image/jpeg;base64," src="mini-neptune" className="planet-pic"/>
                            </div>
                        </div>
                            
                    </div>
                </div>
            </div>
            {window.onload = (e) => slideshow()}
        </div>
    )
}
